import { useState } from 'react';
import './App.css';
import {hello, getSurveyDTO} from './api';
function App() {

    const [state, setState] = useState("");
    const [surveyDTO, setSurveyDTO] = useState({surveyId:null, fixed_entry:null})

    function handleClick(){
        hello().then(response => {
            console.log(response)
            setState(response);
        })
    }

    function handleClickSurvey(){
        getSurveyDTO().then(response => {
            console.log(response);
            setSurveyDTO(response);
        })
    }
    return (
        <div>
            <button onClick={handleClick}>Hello</button>
            <p>
                {state}
            </p>
            <button onClick={handleClickSurvey}>SurveyDTO</button>
            <p>
                surveyId: {surveyDTO.surveyId}<br/>
                fixed_entry: {surveyDTO.fixed_entry}
            </p>
        </div>
    );
}

export default App;
